description:
Patton (1970) (Eng)(NL sub)

Nederlands:
De film vertelt het verhaal van generaal George S. Patton, tijdens zijn opmars
van Noord-Afrika naar Duitsland, gedurende de Tweede Wereldoorlog. De generaal,
beroemd (en berucht) om zijn geniale leiderschap en woedeuitbarstingen, ligt
constant overhoop met zijn meerderen.

English:
The World War II phase of the controversial American general's career is depicted.


Met o.a.
George C. Scott, Karl Malden, Stephen Young


